import React, { useRef, useState } from "react";
import { Button, ButtonToolbar } from "react-bootstrap";
import { Tooltip, OverlayTrigger, Overlay } from "react-bootstrap";
import { Popover } from "react-bootstrap";
import ImageMapper from 'react-image-mapper';

import "./Architecture.css";

export default function Architecture() {

  const URL = "https://demo-object-detection-app.s3.amazonaws.com/architecture3.png"

  const MAP = {
    name: "my-map",
    areas: [
      { name: "1", shape: "circle", coords: [137,58,10], strokeColor: "green" },
      { name: "2", shape: "circle", coords: [247,198.5,10], preFillColor: "pink"  },
      { name: "3", shape: "circle", coords: [485,198,10], preFillColor: "pink"  },
      { name: "4", shape: "circle", coords: [621,330.5,10], preFillColor: "red"  },
      { name: "5", shape: "circle", coords: [484,259,10], preFillColor: "red" },
      { name: "6", shape: "circle", coords: [250,259,10], preFillColor: "red" },

    ]
  }

  const popover = (
        <Popover id="popover-positioned-left" title="Popover left">
          <strong>Holy guacamole!</strong> Check this info.
        </Popover>
  );

  return (
    <OverlayTrigger trigger="click" placement="right" overlay={popover}>
      <ImageMapper src={URL} map={MAP} width={794}/>
    </OverlayTrigger>

  );
}


